sys_variable_value.value:
(function execute(inputs, outputs) {

var rows = new GlideRecord('x_93700_arena_shankaran_pillai_quotes');
rows.query();
var rowCount = rows.getRowCount();
  outputs['rowcount'] = rowCount;

var record = new GlideRecord('x_93700_arena_shankaran_pillai_quotes');
record.addQuery('quote_used', true);
record.query();
var count = record.getRowCount();
  outputs['recordcount'] = count;
if (rowCount == count) {
    record.setValue('quote_used', false);
    record.updateMultiple();
}

})(inputs, outputs);

